import React from "react";
import { Tile } from "../tile/Tile";


// primeste prop de la parent ContactPage
export const TileList = ({datasInfo}) => {
  return (
    <div>
      {datasInfo.map((contact, index)=>(
        <Tile contact={contact} key={index} />
      ))} 
    </div>
  );
};
